import React, { useState } from 'react';

const API_URL = 'http://localhost:8080/api/consultas';

function ConsultasComponent() {
  const [resultados, setResultados] = useState([]);
  const [headers, setHeaders] = useState([]);
  const [titulo, setTitulo] = useState('');
  const [error, setError] = useState('');
  const [parametros, setParametros] = useState({});
  const [consultaAtual, setConsultaAtual] = useState('');

  const consultasDisponiveis = [
    { endpoint: 'jogadores-pvz-clash', titulo: 'Jogadores de PVZ ou Clash Royale' },
    { endpoint: 'contagem-jogos-pessoa', titulo: 'Contagem de Jogos por Pessoa' },
    { endpoint: 'jogos-de-cada-pessoa', titulo: 'Jogos de Cada Pessoa' },
    { endpoint: 'proxima-fase', titulo: 'Sequência de Fases' },
    { endpoint: 'inimigos-fase', titulo: 'Inimigos na Fase', parametros: ['fase'] },
    { endpoint: 'resumo-financeiro-jogador', titulo: 'Resumo Financeiro do Jogador', parametros: ['jogador'] },
    { endpoint: 'anti-join', titulo: 'Pessoa sem jogo jogado' },
    { endpoint: 'full-outer-join', titulo: 'FaseInimigo' },
    { endpoint: 'subconsulta-um', titulo: 'MoedasRestantes acima da média' },
    { endpoint: 'subconsulta-dois', titulo: 'Tempo de jogo acima da média' }
  ];

  const handleParametroChange = (e) => {
    setParametros(prev => ({
      ...prev,
      [e.target.name]: e.target.value
    }));
  };

  const executarConsulta = async (endpoint, tituloConsulta) => {
    try {
      setResultados([]);
      setHeaders([]);
      setError('');
      setTitulo(`Carregando: ${tituloConsulta}...`);

      // Monta query string com parâmetros (ex: ?fase=2&jogador=João)
      const queryString = new URLSearchParams(parametros).toString();
      const response = await fetch(`${API_URL}/${endpoint}${queryString ? `?${queryString}` : ''}`);

      if (!response.ok) throw new Error(`HTTP error! Status: ${response.status}`);

      const data = await response.json();
      if (data.length > 0) {
        setHeaders(Object.keys(data[0]));
        setResultados(data);
      } else {
        setHeaders(['Resultado']);
        setResultados([{ Resultado: 'A consulta não retornou resultados.' }]);
      }
      setTitulo(tituloConsulta);
      setConsultaAtual(endpoint);
    } catch (e) {
      console.error("Erro ao executar consulta:", e);
      setError(`Falha ao executar a consulta. Verifique o console.`);
      setTitulo(tituloConsulta);
    }
  };

  return (
    <div className="component-container">
      <h2>Consultas Especiais</h2>

      <div className="consultas-botoes">
        {consultasDisponiveis.map((c) => (
          <button
            key={c.endpoint}
            onClick={() => {
              setConsultaAtual(c.endpoint);
              setTitulo(c.titulo);
              setParametros({});
            }}
          >
            {c.titulo}
          </button>
        ))}
      </div>

      {consultaAtual && (
        <div className="parametros-container">
          <h3>{titulo}</h3>
          {/* Renderiza campos de filtro se existirem */}
          {consultasDisponiveis.find(c => c.endpoint === consultaAtual)?.parametros?.map(param => (
            <input
              key={param}
              name={param}
              placeholder={`Informe ${param}`}
              value={parametros[param] || ''}
              onChange={handleParametroChange}
            />
          ))}
          <button onClick={() => executarConsulta(consultaAtual, titulo)}>Executar</button>
        </div>
      )}

      {error && <p className="error-message">{error}</p>}

      {resultados.length > 0 && (
        <div className="tabela-container">
          <table className="data-table">
            <thead>
              <tr>{headers.map(h => <th key={h}>{h}</th>)}</tr>
            </thead>
            <tbody>
              {resultados.map((linha, i) => (
                <tr key={i}>
                  {headers.map(h => (
                    <td key={h}>{linha[h] === null ? 'N/A' : String(linha[h])}</td>
                  ))}
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      )}
    </div>
  );
}

export default ConsultasComponent;
